const BN = require('bn.js');
const TestArgument = artifacts.require("TestUnifiedAdditionComponent");

contract("Unified addition gate argument", accounts => {
    it("Case 1", async () => {
        const instance = await TestArgument.deployed();
        var column_rotations = [];
        for (var i = 0; i < 13; i++) {
            column_rotations.push([0,]);
        }
        const tx = await instance.evaluate(
            '',
            new BN('28948022309329048855892746252171976963363056481941560715954676764349967630337', 10),
            new BN('22797834357412815020289958160451856482805460995612001029397557015512073509287', 10),
            column_rotations
        );
        var F_0 = await instance.m_evaluation_result();
        assert.equal(
            F_0.toString(10),
            '25702234092624644042726312154362980424201199232662435662163033853547725161204',
            'F[0] is not correct!'
        );

    });

    it("Case 2", async () => {
        const instance = await TestArgument.deployed();
        var column_rotations = [];
        for (var i = 0; i < 13; i++) {
            column_rotations.push([0,]);
        }
        const tx = await instance.evaluate(
            '',
            new BN('28948022309329048855892746252171976963363056481941560715954676764349967630337', 10),
            new BN('4387975214405445736338502536245523545313102033563631906974565271463139795148', 10),
            column_rotations
        );
        var F_0 = await instance.m_evaluation_result();
        assert.equal(
            F_0.toString(10),
            '7033975822268285011178496782278652923246224163292143269990651447719812779495',
            'F[0] is not correct!'
        );

    });

});
